import React from "react";
import {
  StyleSheet,
  View,
  TouchableOpacity,
  Image,
  Text,
  ScrollView,
} from "react-native";
import ActiveCategoryBtn from "./components/cartOrder/ActiveCategoryBtn";
import CategoryBtn from "./components/cartOrder/CategoryBtn";
import ItemContainer from "./components/cartOrder/ItemContainer";
import CartItem from "./components/cartOrder/CartItem";
import UntitledComponent from "./components/cartOrder/UntitledComponent";
import { Entypo, Feather } from "@expo/vector-icons";

function OrderCartMain({
  storeDetails,
  setorderDetails,
  orderDetails,
  setpage,
  catalog,
}) {
  return (
    <View style={styles.container}>
      <View style={styles.leftMenuBarContainer}>
        <TouchableOpacity style={styles.menuBtn}>
          <Entypo name="menu" style={styles.menuIcon}></Entypo>
        </TouchableOpacity>
        <Feather name="log-out" style={styles.icon}></Feather>
      </View>
      <View style={styles.menuContainer}>
        <View style={styles.bannerContainer}>
          <Image
            source={require("./assets/images/image_onW3..png")}
            resizeMode="contain"
            style={styles.logo}
          ></Image>
        </View>
        <View style={styles.categoryContainer}>
          <Text style={styles.lblTxt}>Menu Category</Text>
          <View style={styles.scrollArea}>
            <ScrollView
              horizontal={true}
              contentContainerStyle={styles.scrollArea_contentContainerStyle}
            >
              <ActiveCategoryBtn
                style={styles.activeCategoryBtn}
              ></ActiveCategoryBtn>
              <CategoryBtn style={styles.categoryBtn}></CategoryBtn>
              <CategoryBtn style={styles.categoryBtn1}></CategoryBtn>
              <CategoryBtn style={styles.categoryBtn2}></CategoryBtn>
              <CategoryBtn style={styles.categoryBtn3}></CategoryBtn>
              <CategoryBtn style={styles.categoryBtn4}></CategoryBtn>
              <CategoryBtn style={styles.categoryBtn5}></CategoryBtn>
            </ScrollView>
          </View>
        </View>
        <View style={styles.scrollAreaProducts}>
          <ScrollView
            contentContainerStyle={
              styles.scrollAreaProducts_contentContainerStyle
            }
          >
            <ItemContainer style={styles.itemContainer}></ItemContainer>
            <ItemContainer style={styles.itemContainer}></ItemContainer>
            <ItemContainer style={styles.itemContainer}></ItemContainer>
            <ItemContainer style={styles.itemContainer}></ItemContainer>
            <ItemContainer style={styles.itemContainer}></ItemContainer>
            <ItemContainer style={styles.itemContainer}></ItemContainer>
            <ItemContainer style={styles.itemContainer}></ItemContainer>
            <ItemContainer style={styles.itemContainer}></ItemContainer>
            <ItemContainer style={styles.itemContainer1}></ItemContainer>
          </ScrollView>
        </View>
      </View>
      <View style={styles.cartContainer}>
        <Text style={styles.myCartTxt}>My Cart</Text>
        <View style={styles.cartItems}>
          <ScrollView
            horizontal={false}
            contentContainerStyle={styles.cartItems_contentContainerStyle}
          >
            <CartItem style={styles.cartItem1}></CartItem>
            <CartItem style={styles.cartItem2}></CartItem>
            <CartItem style={styles.cartItem3}></CartItem>
            <CartItem style={styles.cartItem4}></CartItem>
            <CartItem style={styles.cartItem5}></CartItem>
          </ScrollView>
        </View>
        <View style={styles.totalsContainer}>
          <View style={styles.topGroupTotalsContainer}>
            <UntitledComponent
              amountValue="N/A"
              amountLbl="Discount"
              style={styles.discountRow}
            ></UntitledComponent>
            <UntitledComponent
              amountValue="$10"
              amountLbl="Subtotal"
              style={styles.subtotalRow}
            ></UntitledComponent>
            <UntitledComponent
              amountValue="$1.35"
              amountLbl="Tax"
              style={styles.taxRow}
            ></UntitledComponent>
          </View>
          <View style={styles.totalRowGroup}>
            <View style={styles.totalRow}>
              <Text style={styles.total2}>Total</Text>
              <Text style={styles.totalValue}>$11.35</Text>
            </View>
            <TouchableOpacity style={styles.discountCodeBtn}>
              <Text style={styles.discountCode}>Discount Code</Text>
            </TouchableOpacity>
          </View>
        </View>
        <View style={styles.checkoutBtn}>
          <Text style={styles.checkoutLbl}>Checkout</Text>
        </View>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
